CREATE TABLE eplusi.youth_org
(
    youth_org_id int(11) PRIMARY KEY NOT NULL COMMENT '이력 ID' AUTO_INCREMENT,
    youth_id int(11) NOT NULL COMMENT '청년 ID',
    org_code int(11) NOT NULL COMMENT '조직 CODE',
    role_code int(11) NOT NULL COMMENT '직분 CODE',
    start_date date,
    end_date date,
    CONSTRAINT youth_belongings_youth_youth_id_fk FOREIGN KEY (youth_id) REFERENCES eplusi.youth (youth_id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT youth_belongings_organization_org_code_fk FOREIGN KEY (org_code) REFERENCES common.organization (org_code) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT youth_belongings_role_type_role_code_fk FOREIGN KEY (role_code) REFERENCES code.role_type (role_code) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX youth_belongings_youth_youth_id_fk ON eplusi.youth_org (youth_id);
CREATE INDEX youth_belongings_organization_org_code_fk ON eplusi.youth_org (org_code);
CREATE INDEX youth_belongings_role_type_role_code_fk ON eplusi.youth_org (role_code);
